import { useState, useEffect } from "react";
import JsonData from "../data/data.json";

const BDBICard = (props) => {
  return (
    <div>
      {props.data.text}
    </div>
  );
};



export const WhyBDBI = () => {
  const [whyPageData, setWhyPageData] = useState({});

  useEffect(() => {
      setWhyPageData(JsonData);
  }, []);

  return (
    <div>
      <BDBICard/>
      <BDBICard data = {whyPageData.About.impactCard}/>
      <BDBICard data = {whyPageData.About.skillCard}/>
      <BDBICard data = {whyPageData.About.professionalCard}/>
    </div>
  );
};
